function klick(el) {
    var className = el.childNodes[0].getAttribute('class');
    document.getElementsByClassName('fontawesomeClass')[0].getElementsByTagName('input')[0].value = className;
    el.className = el.className.replace('active', '');
    el.className += ' active';
}

