	function getVersionCalculation(version){
		var versionCalc = version.split('.');
		var result = 0;
		var multiplier = 10000;
		versionCalc.forEach(function(nr){
			result = result + (parseInt(nr) * multiplier);
			multiplier = multiplier/100;
		});
		return result;
	}

    function faIcons(icons) {
        var result = [];
        for (var x in icons) {
            var icon = icons[x];
			var styleSelected = style;
			
			if(editor.config.fontawesome.edition=='free'){
				var styles = icon.free;
			}else{
				var styles = icon.styles;
			}
			styles.forEach(function(style){	
				if(styleSelected=='' || styleSelected==style){	
					var found = true;
					if(search!=''){
						found = false;
						var searchstring = icon.label.toLowerCase()+','+icon.search.join(",");
						if(searchstring.indexOf(search)>=0){
							found=true;
						}
						
					}
					if(found && icon.changes.length>0){
						if(!checkVersion(icon.changes[0])){
							found=false;
						}
					}
					if(found){
						result.push('<a href="#" onclick="klick(this);return false;" title="' + icon.label + '('+style+')"><span class="fa' + style.substr(0,1) + ' fa-' + x + '"></span><div class="icon-label">' + icon.label + '</div></a>');
					}
				}
			});
        }		
        return result;
    }
	function setStyle(s){
		var btns = document.getElementsByClassName('btnStyles');		
		for(i=0;i<btns.length;i++){
			btns[i].className = btns[i].className.replace(' active', '').replace('active', '');
		}
				
		if(s==style){
			style = '';
		}else{
			style = s;
			var c = 'btnStyle'+s.charAt(0).toUpperCase() + s.slice(1);
			document.getElementsByClassName(c)[0].className+=' active';	
		}
	}
	function checkVersion(version){
		if(versionCurrent>0){
			return getVersionCalculation(version) <= versionCurrent;
		}
		return true;
	}

